import React, { Component } from 'react';

class Search extends Component {
	render() {
		return (
			<div>
				<form className='form'>
					<input type='text' name='text' placeholder='Search for a User...' />

					<input
						type='submit'
						className='btn btn-dark btn-block'
						name='submit'
						label='Submit'
					/>
				</form>
			</div>
		);
	}
}

export default Search;
